import { FormsModule } from '@angular/forms';


@NgModule({
  declarations: [
    AppComponent,
    EquationSolverComponent,
    MatrixComponent,
    NavComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule, 
    HttpClientModule,
    HttpClientXsrfModule.withOptions({
      cookieName: 'csrftoken', 
      headerName: 'X-CSRFToken', 
    }),
    FormsModule,

  ],
  providers: [],
  bootstrap: [AppComponent]
